import React from "react";
import "./style.css";

function DoctorCard() {
  return (
    <div>
      <p>This space is for the doctor API / Google Maps</p>
      <img src="https://miro.medium.com/max/4064/1*qYUvh-EtES8dtgKiBRiLsA.png" className="googleMaps"></img>
    </div>
  );
}

export default DoctorCard;
